import React from 'react';

function UserList () {
  const users = [
    {
      id: 1,
      username: 'rkdud',
      email:'hap@ss',
      active: true,
    },
    {
      id: 2,
      username: 'kyuha',
      email:'pro@nn',
      active: false,
    },
    {
      id: 3,
      username: 'kiki',
      email:'love@dd',
      active: false,
    }
  ]

  return (
    <div>
      <b>{users[0].username}</b><span>{users[0].email}</span>
    </div>
  )

}

export default UserList;
